function shortestPathBinaryMatrix(grid: number[][]): number {
    const mr = grid.length;
    const mc = grid[0].length;

    if (grid[0][0] !== 0) return -1;

    let q: [number, number][] = [[0, 0]];
    let q2: [number, number][] = [];
    let cnt = 1;

    const qpush = (r: number, c: number) => {
        if (r >= 0 && r < mr && c >= 0 && c < mc) {
            if (grid[r][c] === 0) {
                grid[r][c] = 1;
                q2.push([r, c]);
            }
        }
    }

    while (true) {
        while (q.length) {
            const [r, c] = q.pop()!;
            if (r === mr - 1 && c === mc - 1) {
                return cnt;
            };

            qpush(r - 1, c - 1);
            qpush(r - 1, c);
            qpush(r - 1, c + 1);
            qpush(r, c - 1);
            qpush(r, c + 1);
            qpush(r + 1, c - 1);
            qpush(r + 1, c);
            qpush(r + 1, c + 1);
        }
        if (q2.length === 0) return -1;
        q = q2;
        q2 = [];
        cnt++;
    }
    return -1;
};

